-- EBS Match Script

BEGIN
    throw new Exception(''Application Short Name not found. Please Configure FDEBS_APPLICATION_SHORT_NAME property'');
}
if ((FDEBS_APPLICATION_SHORT_NAME == null || FDEBS_APPLICATION_SHORT_NAME == '''') ' || '&&' || ' (FILE_PATH_PREFIX == null || FILE_PATH_PREFIX == '''' || FILE_PATH_PREFIX == ''/'')) {
    throw new Exception(''Application Short Name not found. Please Configure FDEBS_APPLICATION_SHORT_NAME property'')
}
EXT=FILE_EXTENSION.toUpperCase(); 
SQL_EXT=Arrays.asList(FDC.SQL_EXTS.split()); 
PUB_EXT=Arrays.asList(FDC.PUB_EXTS.split()); 
JAVA_EXT=Arrays.asList(FDC.JAVA_EXTS.split()); 
MEDIA_EXT=Arrays.asList(FDC.MEDIA_EXTS.split()); 
HTML_EXT=Arrays.asList(FDC.HTML_EXTS.split()); 
CP_SQL_DIR=FDEBS_CP_SQL_ROOT_SOURCE_DIR != null ? FDEBS_CP_SQL_ROOT_SOURCE_DIR : EBSC.FDEBS_CP_SQL_ROOT_SOURCE_DIR_DEFAULT; 
PUB_DIR=FDEBS_PUBLISHER_ROOT_SOURCE_DIR != null ? FDEBS_PUBLISHER_ROOT_SOURCE_DIR : EBSC.FDEBS_PUBLISHER_ROOT_SOURCE_DIR_DEFAULT; 
JAVA_SP_DIR=FDEBS_LOAD_JAVA_ROOT_SOURCE_DIR != null ? FDEBS_LOAD_JAVA_ROOT_SOURCE_DIR : EBSC.FDEBS_LOAD_JAVA_ROOT_SOURCE_DIR_DEFAULT; 
SCRIPT_DIR=FDEBS_SCRIPTS_ROOT_SOURCE_DIR != null ? FDEBS_SCRIPTS_ROOT_SOURCE_DIR : EBSC.FDEBS_SCRIPTS_ROOT_SOURCE_DIR_DEFAULT; 
FILE_CONTENT_NEEDED=Boolean.FALSE;
if  (((''webui''.equals(FILE_NAME) || ''server''.equals(FILE_NAME)) ' || '&&' || '   EXT.equals(''XML'')) ||  EXT.equals(''XCFG'')) 
{ 
	return FDC.OBJ_TYPE_IGNORE; 
} 
else if  (EXT.equals(''LDT'')) 
{ 
	FILE_CONTENT_NEEDED = Boolean.TRUE; 
	return FDC.OBJ_TYPE_AOL; 
} 
else if ((EXT.equals(''FMB'') || EXT.equals(''FMX''))) 
{ 
	return FDC.OBJ_TYPE_FORM; 
} 
else if ((EXT.equals(''PLL'') || EXT.equals(''PLX''))) 
{ 
	return FDC.OBJ_TYPE_LIBRARY; 
} 
else if (EXT.equals(''RDF'')) 
{ 
	return FDC.OBJ_TYPE_REPORT; 
} 
else if  (EXT.equals(''XDF'')) 
{ 
	FILE_CONTENT_NEEDED = Boolean.TRUE; 
	return FDC.OBJ_TYPE_XDF; 
} 
else if (FILE_PATH_PREFIX.contains(CP_SQL_DIR) 		 
			 ' || '&&' || '  	EXT.equals(''SQL'')) 
{ 
	return FDC.OBJ_TYPE_CP_SQL; 
} 
else if (SQL_EXT.contains(EXT)) 
{ 
	return FDC.OBJ_TYPE_SQL; 
} 
else if (EXT.equals(''PDF'') || EXT.equals(''RTF'') || EXT.equals(''XSD'') || ((FILE_PATH_PREFIX.contains(PUB_DIR) || (PARENT_FOLDER != null && PARENT_FOLDER.contains(PUB_DIR)))		 
		' || '&&' || ' PUB_EXT.contains(EXT))) 
{ 
	return FDC.OBJ_TYPE_PUBLISHER; 
} 
else if (EXT.equals(''XML'')  ' || '&&' || '  FILE_PATH_PREFIX.contains(''/webui'')) 
{ 
	return FDC.OBJ_TYPE_OAF_MDS; 
} 
else if (EXT.equals(''JPX'')) 
{ 
	return FDC.OBJ_TYPE_OAF_MDS; 
} 
else if (FILE_PATH_PREFIX.contains(JAVA_SP_DIR) 		 
			 ' || '&&' || '  	JAVA_EXT.contains(EXT)) 
{ 
	return FDC.OBJ_TYPE_JAVA_SP; 
} 
else if (JAVA_EXT.contains(EXT) || EXT.equals(''XML'')) 
{ 
	return FDC.OBJ_TYPE_JAVA; 
} 
else if (EXT.equals(''WFD'') || EXT.equals(''WFT'')) 
{ 
	return FDC.OBJ_TYPE_WORKFLOW_DEF; 
} 
else if (EXT.equals(''WFX'')) 
{ 
	return FDC.OBJ_TYPE_WORKFLOW_XML; 
} 
else if (HTML_EXT.contains(EXT)) 
{ 
	return FDC.OBJ_TYPE_HTML; 
} 
else if (EXT.equals(''TTF'')) 
{ 
	return FDC.OBJ_TYPE_FONT; 
} 
else if (EXT.equals(''SH'') || EXT.equals(''PL'')  || 	 
		(EXT.equals('''')  ' || '&&' || '  FILE_PATH_PREFIX.contains(SCRIPT_DIR))) 
{ 
	return FDC.OBJ_TYPE_SCRIPT; 
} 
else if (EXT.equals(''PM'')) 
{ 
	return FDC.OBJ_TYPE_PM; 
} 
else if (EXT.equals(''JLT'')) 
{ 
	return FDC.OBJ_TYPE_JLT; 
} 
else if (EXT.equals(''PROG'')) 
{ 
	return FDC.OBJ_TYPE_PROG; 
} 
else if (EXT.equals(''DAT'') || EXT.equals(''CTL'')) 
{ 
	return FDC.OBJ_TYPE_SQL_LDR; 
} 
else if (MEDIA_EXT.contains(EXT)) 
{ 
	return FDC.OBJ_TYPE_MEDIA; 
} 
else 
{ 
	return FDC.OBJ_TYPE_OTHER; 
}',null,'Y',sysdate,'SYSTEM',sysdate,'SYSTEM',1);
END;
